import React from 'react';
import { FaLinkedinIn } from 'react-icons/fa';
import { FaXTwitter } from 'react-icons/fa6';
import { FaNewspaper, FaFileAlt } from 'react-icons/fa';
import { MdEmail } from 'react-icons/md';
import './SocialDock.css';

const SocialDock = () => {
  return (
    <div className="social-dock">
      <a href="https://www.linkedin.com/in/elinapatjas/" target="_blank" rel="noopener noreferrer"><FaLinkedinIn /></a>
      <a href="https://x.com/ElinaPatjas" target="_blank" rel="noopener noreferrer"><FaXTwitter /></a>
      <a href="https://substack.com/@elpat" target="_blank" rel="noopener noreferrer"><FaNewspaper /></a>
      <a href="https://read.cv/elinapatjas" target="_blank" rel="noopener noreferrer"><FaFileAlt /></a>
      <a href="mailto:elina.patjas@gmail.com"><MdEmail /></a>
    </div>
  );
};

export default SocialDock;
